<?php

  class gisDrawMySqlSupport extends db
  {
    public function createTables ()
    {
      $queryLStr = "CREATE TABLE IF NOT EXISTS `map_fill` (
  `id` bigint(20) unsigned NOT NULL,
  `humam_type` varchar(255) NOT NULL,
  `visible_zoom_bigger_than` int(10) unsigned DEFAULT NULL,
  `point_key` varchar(255) DEFAULT NULL,
  `value` varchar(255) DEFAULT NULL,
  `element` text,
  `comment` text,
  `rendering` text,
  `photo` varchar(255) DEFAULT NULL,
  `thickness` int(10) unsigned DEFAULT '0',
  `style` text,
  `fill` text,
  `image_tile` varchar(500) DEFAULT NULL,
  `type` set('line','style','none','filledPolygon') DEFAULT 'none',
  `color_red` int(11) DEFAULT '0',
  `color_green` int(11) DEFAULT '0',
  `color_blue` int(11) DEFAULT '0',
  `color_alpha` int(11) DEFAULT '0'
) ENGINE=InnoDB AUTO_INCREMENT=1138 DEFAULT CHARACTER SET utf8 DEFAULT COLLATE utf8_general_ci;";

      $this->query( $queryLStr, __FILE__, __LINE__ );
      $this->addToCompressedFile( $queryLStr . "\r\n", __FUNCTION__ );

      $queryLStr = "INSERT INTO `map_fill` (`id`, `humam_type`, `visible_zoom_bigger_than`, `point_key`, `value`, `element`, `comment`, `rendering`, `photo`, `thickness`, `style`, `fill`, `image_tile`, `type`, `color_red`, `color_green`, `color_blue`, `color_alpha`) VALUES
(1, 'Aerialway', NULL, 'aerialway', 'cable_car', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Aerial_tramway\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Aerial_tramway\" class=\"extiw\" title=\"wikipedia:en:Aerial tramway\">Cablecar or Tramway</a>. Just one or two large cars. The cable forms a loop, but the cars do not loop around, they just move up and down on their own side.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Mapping-Features-Aerialway.png\" class=\"image\"><img alt=\"Mapping-Features-Aerialway.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/c/c5/Mapping-Features-Aerialway.png/100px-Mapping-Features-Aerialway.png\" width=\"100\" height=\"73\" srcset=\"/w/images/thumb/c/c5/Mapping-Features-Aerialway.png/150px-Mapping-Features-Aerialway.png 1.5x, /w/images/thumb/c/c5/Mapping-Features-Aerialway.png/200px-Mapping-Features-Aerialway.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(2, 'Aerialway', NULL, 'aerialway', 'chair_lift', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Chairlift\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Chairlift\" class=\"extiw\" title=\"wikipedia:en:Chairlift\">Chairlift</a>. Looped cable with a series of single chairs (typically seating two or four people, but can be more). Exposed to the open air (can have a bubble).  This implies <a href=\"/wiki/Key:oneway\" title=\"Key:oneway\">oneway</a>=yes.  Any two-way chairlifts should be tagged <a href=\"/wiki/Key:oneway\" title=\"Key:oneway\">oneway</a>=<a href=\"/wiki/Tag:oneway%3Dno\" title=\"Tag:oneway=no\" class=\"mw-redirect\">no</a>.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Chair_lift_rendering.png\" class=\"image\"><img alt=\"Chair lift rendering.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/8/85/Chair_lift_rendering.png/100px-Chair_lift_rendering.png\" width=\"100\" height=\"32\" srcset=\"/w/images/8/85/Chair_lift_rendering.png 1.5x, /w/images/8/85/Chair_lift_rendering.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(3, 'Aerialway', NULL, 'aerialway', 'drag_lift', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Surface_lift\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Surface_lift\" class=\"extiw\" title=\"wikipedia:en:Surface lift\">Drag lift or Surface lift</a> is an overhead tow-line for skiers and riders. A T-bar lift, button lift, or more simple looped rope drag lifts, or loops of wire with handles to grab. See also <a href=\"/wiki/Key:aerialway\" title=\"Key:aerialway\">aerialway</a>=<a href=\"/wiki/Tag:aerialway%3Dt-bar\" title=\"Tag:aerialway=t-bar\">t-bar</a>, <a href=\"/wiki/Key:aerialway\" title=\"Key:aerialway\">aerialway</a>=<a href=\"/wiki/Tag:aerialway%3Dj-bar\" title=\"Tag:aerialway=j-bar\">j-bar</a>, <a href=\"/wiki/Key:aerialway\" title=\"Key:aerialway\">aerialway</a>=<a href=\"/wiki/Tag:aerialway%3Dplatter\" title=\"Tag:aerialway=platter\">platter</a> and <a href=\"/wiki/Key:aerialway\" title=\"Key:aerialway\">aerialway</a>=<a href=\"/wiki/Tag:aerialway%3Drope_tow\" title=\"Tag:aerialway=rope tow\">rope_tow</a>.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Chair_lift_rendering.png\" class=\"image\"><img alt=\"Chair lift rendering.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/8/85/Chair_lift_rendering.png/100px-Chair_lift_rendering.png\" width=\"100\" height=\"32\" srcset=\"/w/images/8/85/Chair_lift_rendering.png 1.5x, /w/images/8/85/Chair_lift_rendering.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(4, 'Aerialway', NULL, 'aerialway', 'gondola', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Gondola_lift\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Gondola_lift\" class=\"extiw\" title=\"wikipedia:en:Gondola lift\">Gondola lift</a>. Many cars on a looped cable.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Chair_lift_rendering.png\" class=\"image\"><img alt=\"Chair lift rendering.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/8/85/Chair_lift_rendering.png/100px-Chair_lift_rendering.png\" width=\"100\" height=\"32\" srcset=\"/w/images/8/85/Chair_lift_rendering.png 1.5x, /w/images/8/85/Chair_lift_rendering.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(5, 'Aerialway', NULL, 'aerialway', 'goods', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'controversial - consider other aerialway=* values in combination with <a href=\"http://wiki.openstreetmap.org/wiki/Key:foot\" title=\"Key:foot\">foot</a>=<a href=\"/wiki/Tag:foot%3Dno\" title=\"Tag:foot=no\" class=\"mw-redirect\">no</a> and/or a <a href=\"/wiki/Key:usage\" title=\"Key:usage\">usage</a>=* key instead of this', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Aerialway_goods.png\" class=\"image\"><img alt=\"Aerialway goods.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/c/cb/Aerialway_goods.png/100px-Aerialway_goods.png\" width=\"100\" height=\"48\" srcset=\"/w/images/thumb/c/cb/Aerialway_goods.png/150px-Aerialway_goods.png 1.5x, /w/images/thumb/c/cb/Aerialway_goods.png/200px-Aerialway_goods.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(6, 'Aerialway', NULL, 'aerialway', 'j-bar', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:J-bar_lift\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:J-bar_lift\" class=\"extiw\" title=\"wikipedia:en:J-bar lift\">J-bar lift</a>. A type of <a href=\"/wiki/Key:aerialway\" title=\"Key:aerialway\">aerialway</a>=<a href=\"/wiki/Tag:aerialway%3Ddrag_lift\" title=\"Tag:aerialway=drag lift\">drag_lift</a>. Like t-bar but just on one side. This automatically implies <a href=\"/wiki/Key:oneway\" title=\"Key:oneway\">oneway</a>=yes.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(7, 'Aerialway', NULL, 'aerialway', 'magic_carpet', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Magic_carpet_(ski_lift)\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Magic_carpet_(ski_lift)\" class=\"extiw\" title=\"wikipedia:en:Magic carpet (ski lift)\">Magic carpet</a>. A type of ski lift. This automatically implies <a href=\"/wiki/Key:oneway\" title=\"Key:oneway\">oneway</a>=yes.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(8, 'Aerialway', NULL, 'aerialway', 'mixed_lift', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Hybrid_lift\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Hybrid_lift\" class=\"extiw\" title=\"wikipedia:en:Hybrid lift\">Mixed lift</a> Also known as a hybrid lift is a new type of ski lift that combines the elements of a chairlift and a gondola lift.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Chair_lift_rendering.png\" class=\"image\"><img alt=\"Chair lift rendering.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/8/85/Chair_lift_rendering.png/100px-Chair_lift_rendering.png\" width=\"100\" height=\"32\" srcset=\"/w/images/8/85/Chair_lift_rendering.png 1.5x, /w/images/8/85/Chair_lift_rendering.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(9, 'Aerialway', NULL, 'aerialway', 'platter', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Platter_lift\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Platter_lift\" class=\"extiw\" title=\"wikipedia:en:Platter lift\">Platter lift</a>. A type of <a href=\"/wiki/Key:aerialway\" title=\"Key:aerialway\">aerialway</a>=<a href=\"/wiki/Tag:aerialway%3Ddrag_lift\" title=\"Tag:aerialway=drag lift\">drag_lift</a>. Similar to a t-bar, but with a disc instead of a bar. Single-person only. This automatically implies <a href=\"/wiki/Key:oneway\" title=\"Key:oneway\">oneway</a>=yes.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(10, 'Aerialway', NULL, 'aerialway', 'pylon', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Aerial_lift_pylon\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Aerial_lift_pylon\" class=\"extiw\" title=\"wikipedia:en:Aerial lift pylon\">Aerial lift pylon</a> is a pylon supporting the aerialway cable.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(11, 'Aerialway', NULL, 'aerialway', 'rope_tow', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Ski_tow\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Ski_tow\" class=\"extiw\" title=\"wikipedia:en:Ski tow\">Rope tow</a>. A type of <a href=\"/wiki/Key:aerialway\" title=\"Key:aerialway\">aerialway</a>=<a href=\"/wiki/Tag:aerialway%3Ddrag_lift\" title=\"Tag:aerialway=drag lift\">drag_lift</a>. This automatically implies <a href=\"/wiki/Key:oneway\" title=\"Key:oneway\">oneway</a>=yes.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(12, 'Aerialway', NULL, 'aerialway', 'station', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A station, where passengers can enter and/or leave the aerialway', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(13, 'Aerialway', NULL, 'aerialway', 't-bar', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:T-bar_lift\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:T-bar_lift\" class=\"extiw\" title=\"wikipedia:en:T-bar lift\">T-bar lift</a>.  A type of <a href=\"/wiki/Key:aerialway\" title=\"Key:aerialway\">aerialway</a>=<a href=\"/wiki/Tag:aerialway%3Ddrag_lift\" title=\"Tag:aerialway=drag lift\">drag_lift</a>. This automatically implies <a href=\"/wiki/Key:oneway\" title=\"Key:oneway\">oneway</a>=yes.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
