(29, '', NULL, 'amenity', 'bar', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'Bar is a purpose-built commercial establishment that sells alcoholic drinks to be consumed on the premises. They are characterised by a noisy and vibrant atmosphere, similar to a party and usually don''t sell food. See also the description of the tags <a href=\"http://wiki.openstreetmap.org/wiki/Key:amenity\" title=\"Key:amenity\">amenity</a>=<a href=\"/wiki/Tag:amenity%3Dpub\" title=\"Tag:amenity=pub\">pub</a>;<a href=\"/wiki/Tag:amenity%3Dbar\" title=\"Tag:amenity=bar\">bar</a>;<a href=\"/wiki/Tag:amenity%3Drestaurant\" title=\"Tag:amenity=restaurant\">restaurant</a> for a distinction between these.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Bar-16.svg\" class=\"image\"><img alt=\"Bar-16.svg\" src=\"http://wiki.openstreetmap.org/w/images/thumb/9/94/Bar-16.svg/32px-Bar-16.svg.png\" width=\"32\" height=\"32\" srcset=\"/w/images/thumb/9/94/Bar-16.svg/48px-Bar-16.svg.png 1.5x, /w/images/thumb/9/94/Bar-16.svg/64px-Bar-16.svg.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(30, '', NULL, 'amenity', 'bbq', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'BBQ or Barbecue is a permanently built grill for cooking food, which is most typically used outdoors by the public. For example these may be found in city parks or at beaches. Use the tag <a href=\"http://wiki.openstreetmap.org/wiki/Key:fuel\" title=\"Key:fuel\">fuel</a>=* to specify the source of heating, such as <a href=\"/wiki/Key:fuel\" title=\"Key:fuel\">fuel</a>=<a href=\"/w/index.php?title=Tag:fuel%3Dwood&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Tag:fuel=wood (page does not exist)\">wood</a>;<a href=\"/w/index.php?title=Tag:fuel%3Delectric&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Tag:fuel=electric (page does not exist)\">electric</a>;<a href=\"/w/index.php?title=Tag:fuel%3Dcharcoal&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Tag:fuel=charcoal (page does not exist)\">charcoal</a>. For mapping nearby table and chairs, see also the tag <a href=\"/wiki/Key:tourism\" title=\"Key:tourism\">tourism</a>=<a href=\"/wiki/Tag:tourism%3Dpicnic_site\" title=\"Tag:tourism=picnic site\">picnic_site</a>. For mapping campfires and firepits, instead use the tag <a href=\"/wiki/Key:leisure\" title=\"Key:leisure\">leisure</a>=<a href=\"/wiki/Tag:leisure%3Dfirepit\" title=\"Tag:leisure=firepit\">firepit</a>.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(31, '', NULL, 'amenity', 'biergarten', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'Biergarten or beer garden is an open-air area where alcoholic beverages along with food is prepared and served. See also the description of the tags <a href=\"http://wiki.openstreetmap.org/wiki/Key:amenity\" title=\"Key:amenity\">amenity</a>=<a href=\"/wiki/Tag:amenity%3Dpub\" title=\"Tag:amenity=pub\">pub</a>;<a href=\"/wiki/Tag:amenity%3Dbar\" title=\"Tag:amenity=bar\">bar</a>;<a href=\"/wiki/Tag:amenity%3Drestaurant\" title=\"Tag:amenity=restaurant\">restaurant</a>. A biergarten can commonly be found attached to a beer hall, pub, bar, or restaurant. In this case, you can use <a href=\"/wiki/Key:biergarten\" title=\"Key:biergarten\" class=\"mw-redirect\">biergarten</a>=<a href=\"/w/index.php?title=Tag:biergarten%3Dyes&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Tag:biergarten=yes (page does not exist)\">yes</a> additional to <a href=\"/wiki/Key:amenity\" title=\"Key:amenity\">amenity</a>=<a href=\"/wiki/Tag:amenity%3Dpub\" title=\"Tag:amenity=pub\">pub</a>;<a href=\"/wiki/Tag:amenity%3Dbar\" title=\"Tag:amenity=bar\">bar</a>;<a href=\"/wiki/Tag:amenity%3Drestaurant\" title=\"Tag:amenity=restaurant\">restaurant</a>.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Biergarten-16.svg\" class=\"image\"><img alt=\"Biergarten-16.svg\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/e1/Biergarten-16.svg/32px-Biergarten-16.svg.png\" width=\"32\" height=\"32\" srcset=\"/w/images/thumb/e/e1/Biergarten-16.svg/48px-Biergarten-16.svg.png 1.5x, /w/images/thumb/e/e1/Biergarten-16.svg/64px-Biergarten-16.svg.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(32, '', NULL, 'amenity', 'cafe', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'Cafe is generally an informal place that offers casual meals and beverages, typically, the focus is on coffee or tea. Also known as a coffeehouse/shop, bistro or sidewalk cafe. The kind of food served may be mapped with the tags <a href=\"http://wiki.openstreetmap.org/wiki/Key:cuisine\" title=\"Key:cuisine\">cuisine</a>=* and <a href=\"/wiki/Key:diet\" title=\"Key:diet\">diet</a>=*. See also the tags <a href=\"/wiki/Key:amenity\" title=\"Key:amenity\">amenity</a>=<a href=\"/wiki/Tag:amenity%3Drestaurant\" title=\"Tag:amenity=restaurant\">restaurant</a>;<a href=\"/wiki/Tag:amenity%3Dbar\" title=\"Tag:amenity=bar\">bar</a>;<a href=\"/wiki/Tag:amenity%3Dfast_food\" title=\"Tag:amenity=fast food\">fast_food</a>.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Cafe-16.svg\" class=\"image\"><img alt=\"Cafe-16.svg\" src=\"http://wiki.openstreetmap.org/w/images/thumb/d/da/Cafe-16.svg/16px-Cafe-16.svg.png\" width=\"16\" height=\"16\" srcset=\"/w/images/thumb/d/da/Cafe-16.svg/24px-Cafe-16.svg.png 1.5x, /w/images/thumb/d/da/Cafe-16.svg/32px-Cafe-16.svg.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(33, '', NULL, 'amenity', 'drinking_water', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'Drinking water is a place where humans can obtain potable water for consumption. Typically, the water is used for only drinking. Also known as a drinking fountain or bubbler.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Drinking-water-16.svg\" class=\"image\"><img alt=\"Drinking-water-16.svg\" src=\"http://wiki.openstreetmap.org/w/images/thumb/0/08/Drinking-water-16.svg/32px-Drinking-water-16.svg.png\" width=\"32\" height=\"32\" srcset=\"/w/images/thumb/0/08/Drinking-water-16.svg/48px-Drinking-water-16.svg.png 1.5x, /w/images/thumb/0/08/Drinking-water-16.svg/64px-Drinking-water-16.svg.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
