(149, '', NULL, 'barrier', 'debris', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A road is blocked by debris with or without ground. This might be for short or long time. Often used as first step in blocking an abandoned road. The photo does not display the road after the debris because it was a slope road and the photo was taken on the top.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(150, '', NULL, 'barrier', 'entrance', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A gap in a linear barrier with nothing that limits passing through. <a href=\"http://wiki.openstreetmap.org/wiki/Key:access\" title=\"Key:access\">access</a>=yes is implied. The limitations are the same of the way that crosses it, if there is such.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(151, '', NULL, 'barrier', 'full-height_turnstile', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A full-height turnstile, also called HEET-turnstile (High Entrance/Exit Turnstile), like the ones to access security areas. Note the mix of hyphen and underscore.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(152, '', NULL, 'barrier', 'gate', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'An entrance that can be opened or closed to get through the barrier. Combine with <a href=\"http://wiki.openstreetmap.org/wiki/Key:access\" title=\"Key:access\">access</a>=* where appropriate.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Barrier_gate.svg\" class=\"image\"><img alt=\"Barrier gate.svg\" src=\"http://wiki.openstreetmap.org/w/images/thumb/9/97/Barrier_gate.svg/32px-Barrier_gate.svg.png\" width=\"32\" height=\"27\" srcset=\"/w/images/thumb/9/97/Barrier_gate.svg/48px-Barrier_gate.svg.png 1.5x, /w/images/thumb/9/97/Barrier_gate.svg/64px-Barrier_gate.svg.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(153, '', NULL, 'barrier', 'hampshire_gate', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A section of wire fence which can be removed temporarily. Combine with <a href=\"http://wiki.openstreetmap.org/wiki/Key:access\" title=\"Key:access\">access</a>=* where appropriate.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(154, '', NULL, 'barrier', 'height_restrictor', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'Combine with <a href=\"http://wiki.openstreetmap.org/wiki/Key:maxheight\" title=\"Key:maxheight\">maxheight</a>=*.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(155, '', NULL, 'barrier', 'horse_stile', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A horse stile allows pedestrians and horses to cross a gap through a fence, but prevents or makes it very difficult for motorcycles and live stock to cross.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(156, '', NULL, 'barrier', 'jersey_barrier', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A <a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/Jersey_barrier\" class=\"extiw\" title=\"wikipedia:Jersey barrier\">jersey barrier</a> consists of heavy prefabricated blocks to create a barrier. Use <a href=\"/wiki/Key:material\" title=\"Key:material\">material</a>=plastic or <a href=\"/wiki/Key:material\" title=\"Key:material\">material</a>=concrete to express the used material.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(157, '', NULL, 'barrier', 'kent_carriage_gap', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A Kent carriage gap is used by local authorities in the UK to prevent motorised vehicles from accessing public rights of way whilst allowing most horse drawn carriages to pass. These are now becoming common on byways in the UK', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(158, '', NULL, 'barrier', 'kissing_gate', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A gate which allows people to cross, but not livestock.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(159, '', NULL, 'barrier', 'lift_gate', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A lift gate (boom barrier) is a bar, or pole pivoted in such a way as to allow the boom to block vehicular access through a controlled point. Combine with <a href=\"http://wiki.openstreetmap.org/wiki/Key:access\" title=\"Key:access\">access</a>=* where appropriate.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Liftgate-7.svg\" class=\"image\"><img alt=\"Liftgate-7.svg\" src=\"http://wiki.openstreetmap.org/w/images/thumb/8/8f/Liftgate-7.svg/32px-Liftgate-7.svg.png\" width=\"32\" height=\"23\" srcset=\"/w/images/thumb/8/8f/Liftgate-7.svg/48px-Liftgate-7.svg.png 1.5x, /w/images/thumb/8/8f/Liftgate-7.svg/64px-Liftgate-7.svg.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(160, '', NULL, 'barrier', 'log', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Use this when the passage is closed by lumber (trunk of a tree). This kind of barrier is often useful to sit on. This barrier is a penalty to cyclists but can be crossed by lifting the bike over.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(161, '', NULL, 'barrier', 'motorcycle_barrier', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'Barriers along paths that prevent access by motorcycles.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(162, '', NULL, 'barrier', 'rope', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A flexible barrier made of fibres, twisted or braided together to improve strength. As a barrier it is often more symbolic than actually physically preventing pedestrians from accessing.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(163, '', NULL, 'barrier', 'sally_port', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A <a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/Sally_port\" class=\"extiw\" title=\"wikipedia:Sally port\">sally port</a> is used to pass through thick or city walls, and is a type of covered gate with two doors.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(164, '', NULL, 'barrier', 'spikes', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'Spikes on the ground that prevent unauthorized access. Can also be removeable e.g. after payment in a garage.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(165, '', NULL, 'barrier', 'stile', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A stile allows pedestrians to cross a wall or fence, but never actually \"opens\" the barrier (unlike a gate, a stile has few or no moving parts).', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(166, '', NULL, 'barrier', 'sump_buster', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A <a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/Sump_buster\" class=\"extiw\" title=\"wikipedia:Sump buster\">sump buster</a> is a concrete slab or steel structure that prevents passing of two-tracked vehicles with less than a minimum track and ground clearance. (Typically stops normal cars.)', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(167, '', NULL, 'barrier', 'swing_gate', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'Similar to a lift gate but rotates sidewards to open. It is usually made out of metal bars (wood or other material possible) and is intended to prevent cars from access but can usually be crossed by pedestrians and cyclists.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(168, '', NULL, 'barrier', 'toll_booth', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A road usage toll or fee is collected here. Used with <a href=\"http://wiki.openstreetmap.org/wiki/Key:toll\" title=\"Key:toll\">toll</a>=* and <a href=\"/w/index.php?title=Key:charge&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Key:charge (page does not exist)\">charge</a>=*', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(169, '', NULL, 'barrier', 'turnstile', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A turnstile (also called baffle gate) is used to allow one person at a time to pass. Use this for small turnstiles like the ones in supermarkets or some subways.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
