(328, '', NULL, 'highway', 'living_street', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'For <a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/living_street\" class=\"extiw\" title=\"wikipedia:living street\">living streets</a>, which are residential streets where pedestrians have legal priority over cars, speeds are kept very low and where children are allowed to play on the street.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Living_street_osm.png\" class=\"image\"><img alt=\"Living street osm.png\" src=\"http://wiki.openstreetmap.org/w/images/1/10/Living_street_osm.png\" width=\"100\" height=\"75\" /></a>', NULL, 2, NULL, NULL, '', 'line', 234, 219, 253, 0),
(329, '', NULL, 'highway', 'pedestrian', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'For roads used mainly/exclusively for pedestrians in shopping and some residential areas which may allow access by motorised vehicles only for very limited periods of the day. To create a ''square'' or ''plaza'' create a closed way and tag as pedestrian and also with <a href=\"http://wiki.openstreetmap.org/wiki/Key:area\" title=\"Key:area\">area</a>=yes.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Pedestrian_with_area_osm.png\" class=\"image\"><img alt=\"Pedestrian with area osm.png\" src=\"http://wiki.openstreetmap.org/w/images/0/07/Pedestrian_with_area_osm.png\" width=\"100\" height=\"75\" /></a>', NULL, 2, NULL, NULL, '', 'line', 234, 219, 253, 0),
(330, '', NULL, 'highway', 'track', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Roads for mostly agricultural or forestry uses. To describe the quality of a track, see <a href=\"http://wiki.openstreetmap.org/wiki/Key:tracktype\" title=\"Key:tracktype\">tracktype</a>=*. Note: Although tracks are often rough with unpaved surfaces, this tag is not describing the quality of a road but its use. Consequently, if you want to tag a general use road, use one of the <a href=\"#Roads\">general highway values</a> instead of track.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-highway_track.png\" class=\"image\"><img alt=\"Rendering-highway track.png\" src=\"http://wiki.openstreetmap.org/w/images/8/86/Rendering-highway_track.png\" width=\"100\" height=\"75\" /></a>', NULL, 2, NULL, NULL, '', 'line', 234, 219, 253, 0),
(331, '', NULL, 'highway', 'bus_guideway', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A busway where the vehicle guided by the way (though not a railway) and is not suitable for other traffic. Please note: this is not a normal bus lane, use <a href=\"http://wiki.openstreetmap.org/wiki/Key:access\" title=\"Key:access\">access</a>=no, <a href=\"/wiki/Key:psv\" title=\"Key:psv\">psv</a>=yes instead!', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-highway-bus_guideway-mapnik.png\" class=\"image\"><img alt=\"Rendering-highway-bus guideway-mapnik.png\" src=\"http://wiki.openstreetmap.org/w/images/d/d4/Rendering-highway-bus_guideway-mapnik.png\" width=\"100\" height=\"75\" /></a>', NULL, 2, NULL, NULL, '', 'line', 234, 219, 253, 0),
(332, '', NULL, 'highway', 'raceway', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A course or track for (motor) racing', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-highway-raceway-mapnik.png\" class=\"image\"><img alt=\"Rendering-highway-raceway-mapnik.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/9/97/Rendering-highway-raceway-mapnik.png/100px-Rendering-highway-raceway-mapnik.png\" width=\"100\" height=\"82\" srcset=\"/w/images/9/97/Rendering-highway-raceway-mapnik.png 1.5x, /w/images/9/97/Rendering-highway-raceway-mapnik.png 2x\" /></a>', NULL, 2, NULL, NULL, '', 'line', 234, 219, 253, 0),
(333, '', NULL, 'highway', 'road', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A road where the mapper is unable to ascertain the classification from the information available. This is intended as a temporary tag to mark a road until it has been properly surveyed. Once it has been surveyed, the classification should be updated to the appropriate value.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-highway-road-mapnik.png\" class=\"image\"><img alt=\"Rendering-highway-road-mapnik.png\" src=\"http://wiki.openstreetmap.org/w/images/5/53/Rendering-highway-road-mapnik.png\" width=\"100\" height=\"52\" /></a>', NULL, 2, NULL, NULL, '', 'line', 234, 219, 253, 0),
(334, '', NULL, 'highway', 'footway', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'For designated footpaths; i.e., mainly/exclusively for pedestrians. This includes walking tracks and gravel paths. If bicycles are allowed as well, you can indicate this by adding a <a href=\"http://wiki.openstreetmap.org/wiki/Key:bicycle\" title=\"Key:bicycle\">bicycle</a>=yes tag.  Should not be used for paths where the primary or intended usage is unknown. Use <a href=\"/wiki/Key:highway\" title=\"Key:highway\">highway</a>=<a href=\"/wiki/Tag:highway%3Dpedestrian\" title=\"Tag:highway=pedestrian\">pedestrian</a> for pedestrianised roads in shopping or residential areas and <a href=\"/wiki/Key:highway\" title=\"Key:highway\">highway</a>=<a href=\"/wiki/Tag:highway%3Dtrack\" title=\"Tag:highway=track\">track</a> if it is usable by agricultural or similar vehicles.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-highway_footway.png\" class=\"image\"><img alt=\"Rendering-highway footway.png\" src=\"http://wiki.openstreetmap.org/w/images/b/b7/Rendering-highway_footway.png\" width=\"100\" height=\"75\" /></a>', NULL, 2, NULL, NULL, '', 'line', 234, 219, 253, 0),
(335, '', NULL, 'highway', 'bridleway', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'For horses. Equivalent to <a href=\"http://wiki.openstreetmap.org/wiki/Key:highway\" title=\"Key:highway\">highway</a>=<a href=\"/wiki/Tag:highway%3Dpath\" title=\"Tag:highway=path\">path</a> + <a href=\"/wiki/Key:horse\" title=\"Key:horse\">horse</a>=<a href=\"/wiki/Tag:horse%3Ddesignated\" title=\"Tag:horse=designated\" class=\"mw-redirect\">designated</a>.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-highway_bridleway.png\" class=\"image\"><img alt=\"Rendering-highway bridleway.png\" src=\"http://wiki.openstreetmap.org/w/images/a/af/Rendering-highway_bridleway.png\" width=\"100\" height=\"75\" /></a>', NULL, 2, NULL, NULL, '', 'line', 234, 219, 253, 0),
(336, '', NULL, 'highway', 'steps', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'For flights of steps (stairs) on footways. Use with <a href=\"http://wiki.openstreetmap.org/wiki/Key:step_count\" title=\"Key:step count\">step_count</a>=* to indicate the number of steps', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-highway_steps.png\" class=\"image\"><img alt=\"Rendering-highway steps.png\" src=\"http://wiki.openstreetmap.org/w/images/4/44/Rendering-highway_steps.png\" width=\"100\" height=\"75\" /></a>', NULL, 2, NULL, NULL, '', 'line', 234, 219, 253, 0),
(337, '', NULL, 'highway', 'path', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A non-specific path. Use <a href=\"http://wiki.openstreetmap.org/wiki/Key:highway\" title=\"Key:highway\">highway</a>=<a href=\"/wiki/Tag:highway%3Dfootway\" title=\"Tag:highway=footway\">footway</a> for paths mainly for walkers,  <a href=\"/wiki/Key:highway\" title=\"Key:highway\">highway</a>=<a href=\"/wiki/Tag:highway%3Dcycleway\" title=\"Tag:highway=cycleway\">cycleway</a> for one also usable by cyclists, <a href=\"/wiki/Key:highway\" title=\"Key:highway\">highway</a>=<a href=\"/wiki/Tag:highway%3Dbridleway\" title=\"Tag:highway=bridleway\">bridleway</a> for ones available to horses as well as walkers and <a href=\"/wiki/Key:highway\" title=\"Key:highway\">highway</a>=<a href=\"/wiki/Tag:highway%3Dtrack\" title=\"Tag:highway=track\">track</a> for ones which is passable by agriculture or similar vehicles.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Path_osm.png\" class=\"image\"><img alt=\"Path osm.png\" src=\"http://wiki.openstreetmap.org/w/images/9/93/Path_osm.png\" width=\"100\" height=\"75\" /></a>', NULL, 2, NULL, NULL, '', 'line', 234, 219, 253, 0),
(338, '', NULL, 'sidewalk', 'both / left / right / no', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Specifies that the highways has sidewalks on both sides, on one side or no sidewalk at all', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(339, '', NULL, 'highway', 'cycleway', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'For designated cycleways. Add <a href=\"http://wiki.openstreetmap.org/wiki/Key:foot\" title=\"Key:foot\">foot</a>=* only if <a href=\"/wiki/OSM_tags_for_routing/Access-Restrictions\" title=\"OSM tags for routing/Access-Restrictions\">default-access-restrictions</a> do not apply.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Cycleway_osm.png\" class=\"image\"><img alt=\"Cycleway osm.png\" src=\"http://wiki.openstreetmap.org/w/images/2/28/Cycleway_osm.png\" width=\"100\" height=\"75\" /></a>', NULL, 2, NULL, NULL, '', 'line', 234, 219, 253, 0),
(340, '', NULL, 'cycleway', 'lane', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A lane is a route that lies within the roadway', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(341, '', NULL, 'cycleway', 'opposite', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Used on ways with <a href=\"http://wiki.openstreetmap.org/wiki/Key:oneway\" title=\"Key:oneway\">oneway</a>=<a href=\"/wiki/Tag:oneway%3Dyes\" title=\"Tag:oneway=yes\" class=\"mw-redirect\">yes</a> where it is legally permitted to cycle in both directions. Used together with <a href=\"/wiki/Key:oneway:bicycle\" title=\"Key:oneway:bicycle\" class=\"mw-redirect\">oneway:bicycle</a>=<a href=\"/w/index.php?title=Tag:oneway:bicycle%3Dno&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Tag:oneway:bicycle=no (page does not exist)\">no</a>.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(342, '', NULL, 'cycleway', 'opposite_lane', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Used on ways with <a href=\"http://wiki.openstreetmap.org/wiki/Key:oneway\" title=\"Key:oneway\">oneway</a>=<a href=\"/wiki/Tag:oneway%3Dyes\" title=\"Tag:oneway=yes\" class=\"mw-redirect\">yes</a> that have a cycling lane going the opposite direction of normal traffic flow (a \"contraflow\" lane). Used together with <a href=\"/wiki/Key:oneway:bicycle\" title=\"Key:oneway:bicycle\" class=\"mw-redirect\">oneway:bicycle</a>=<a href=\"/w/index.php?title=Tag:oneway:bicycle%3Dno&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Tag:oneway:bicycle=no (page does not exist)\">no</a>.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(343, '', NULL, 'cycleway', 'track', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A track provides a route that is separated from traffic. In the United States, this term is often used to refer to bike lanes that are separated from lanes for cars by pavement buffers, bollards, parking lanes, and curbs. Note that a cycle track may alternatively be drawn as a separate way next to the road which is tagged as <a href=\"http://wiki.openstreetmap.org/wiki/Key:highway\" title=\"Key:highway\">highway</a>=<a href=\"/wiki/Tag:highway%3Dcycleway\" title=\"Tag:highway=cycleway\">cycleway</a>.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(344, '', NULL, 'cycleway', 'opposite_track', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Used on ways with <a href=\"http://wiki.openstreetmap.org/wiki/Key:oneway\" title=\"Key:oneway\">oneway</a>=<a href=\"/wiki/Tag:oneway%3Dyes\" title=\"Tag:oneway=yes\" class=\"mw-redirect\">yes</a> that have a cycling track going the opposite direction of normal traffic flow', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(345, '', NULL, 'cycleway', 'share_busway', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'There is a bus lane that cyclists are permitted to use.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
