(615, '', NULL, 'place', 'county', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'See <a href=\"http://wiki.openstreetmap.org/wiki/Key:boundary\" title=\"Key:boundary\">boundary</a>=<a href=\"/wiki/Tag:boundary%3Dadministrative\" title=\"Tag:boundary=administrative\">administrative</a>, <a href=\"/wiki/Key:admin_level\" title=\"Key:admin level\" class=\"mw-redirect\">admin_level</a>=* varies; may not be used in all countries.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(616, '', NULL, 'place', 'municipality', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'See <a href=\"http://wiki.openstreetmap.org/wiki/Key:boundary\" title=\"Key:boundary\">boundary</a>=<a href=\"/wiki/Tag:boundary%3Dadministrative\" title=\"Tag:boundary=administrative\">administrative</a>, <a href=\"/wiki/Key:admin_level\" title=\"Key:admin level\" class=\"mw-redirect\">admin_level</a>=* varies; depending on the country a collection of arbitrary hamlets, villages and towns may form an administrative unit; sometimes members of a unit reform or join with another municipality as a result of political process.  Within a municipality individual settlements are a lot less connected than those within a city, where they have grown connected over time.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(617, '', NULL, 'place', 'city', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'The largest urban settlements in the territory, normally including the national, state and provincial capitals. These are defined by charter or other governmental designation in some territories and are a matter of judgement in others. Should normally have a population of at least 100,000 people and be larger than nearby towns. See <a href=\"http://wiki.openstreetmap.org/wiki/Key:place\" title=\"Key:place\">place</a>=<a href=\"/wiki/Tag:place%3Dsuburb\" title=\"Tag:place=suburb\">suburb</a> and <a href=\"/wiki/Key:place\" title=\"Key:place\">place</a>=<a href=\"/wiki/Tag:place%3Dneighbourhood\" title=\"Tag:place=neighbourhood\">neighbourhood</a> on how to tag divisions within a city. The outskirts of urban settlements may or may not match the administratively declared boundary of the city.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0);";

