      $queryLStr = "INSERT INTO `map_fill` (`id`, `humam_type`, `visible_zoom_bigger_than`, `point_key`, `value`, `element`, `comment`, `rendering`, `photo`, `thickness`, `style`, `fill`, `image_tile`, `type`, `color_red`, `color_green`, `color_blue`, `color_alpha`) VALUES
(618, '', NULL, 'place', 'borough', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'See <a href=\"http://wiki.openstreetmap.org/wiki/Key:boundary\" title=\"Key:boundary\">boundary</a>=<a href=\"/wiki/Tag:boundary%3Dadministrative\" title=\"Tag:boundary=administrative\">administrative</a>, depending on the country suburbs in larger cities are often grouped into administrative units called boroughs or city districts; using the value borough avoids name confusion in countries that declare districts within their states or counties.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(619, '', NULL, 'place', 'suburb', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A distinct section of an urban settlement (city, town, etc.) with its own name and identity.  e.g.\r\n annexed towns or villages which were formerly independent,\r\n independent (or dependent) municipalities within a city or next to a much bigger town\r\n historical districts of settlements\r\n industrial districts or recreation areas within a settlements with specific names.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(620, '', NULL, 'place', 'quarter', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A named part of a bigger settlement where this part is smaller than a suburb and bigger than a neighbourhood. This does not have to be an administrative entity.The term quarter is sometimes used synonymously for neighbourhood.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(621, '', NULL, 'place', 'neighbourhood', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A named part of a <a href=\"http://wiki.openstreetmap.org/wiki/Key:place\" title=\"Key:place\">place</a>=<a href=\"/wiki/Tag:place%3Dvillage\" title=\"Tag:place=village\">village</a>, a <a href=\"/wiki/Key:place\" title=\"Key:place\">place</a>=<a href=\"/wiki/Tag:place%3Dtown\" title=\"Tag:place=town\">town</a> or a <a href=\"/wiki/Key:place\" title=\"Key:place\">place</a>=<a href=\"/wiki/Tag:place%3Dcity\" title=\"Tag:place=city\">city</a>. Smaller than <a href=\"/wiki/Key:place\" title=\"Key:place\">place</a>=<a href=\"/wiki/Tag:place%3Dsuburb\" title=\"Tag:place=suburb\">suburb</a> and <a href=\"/wiki/Key:place\" title=\"Key:place\">place</a>=<a href=\"/wiki/Tag:place%3Dquarter\" title=\"Tag:place=quarter\">quarter</a>.The term quarter is sometimes used synonymously for neighbourhood, but may also stand for borough or suburb and hence is often avoided in OSM. See <a href=\"http://en.wikipedia.org/wiki/en:Quarter_(urban_subdivision)\" title=\"wikipedia:en:Quarter (urban subdivision)\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a>&#160;<a href=\"http://en.wikipedia.org/wiki/en:Quarter_(urban_subdivision)\" class=\"extiw\" title=\"wikipedia:en:Quarter (urban subdivision)\">Quarter_(urban_subdivision)</a>', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(622, '', NULL, 'place', 'city_block', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A named city block that is part of a <a href=\"http://wiki.openstreetmap.org/wiki/Key:place\" title=\"Key:place\">place</a>=<a href=\"/wiki/Tag:place%3Dcity\" title=\"Tag:place=city\">city</a>. See <a href=\"http://en.wikipedia.org/wiki/en:City_block\" title=\"wikipedia:en:City block\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a>&#160;<a href=\"http://en.wikipedia.org/wiki/en:City_block\" class=\"extiw\" title=\"wikipedia:en:City block\">City_block</a>', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(623, '', NULL, 'place', 'plot', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A named plot is a tract or parcel of land owned or meant to be owned by some owner.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(624, '', NULL, 'place', 'town', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A second tier urban settlement of local importance, often with a population of 10,000 people and good range of local facilities including schools, medical facilities etc and traditionally a market. In areas of low population, towns may have significantly lower populations. See <a href=\"http://wiki.openstreetmap.org/wiki/Key:place\" title=\"Key:place\">place</a>=<a href=\"/wiki/Tag:place%3Dneighbourhood\" title=\"Tag:place=neighbourhood\">neighbourhood</a> and possibly also <a href=\"/wiki/Key:place\" title=\"Key:place\">place</a>=<a href=\"/wiki/Tag:place%3Dsuburb\" title=\"Tag:place=suburb\">suburb</a> on how to tag divisions within a town.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(625, '', NULL, 'place', 'village', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A smaller distinct settlement, smaller than a town with few facilities available with people traveling to nearby towns to access these. Populations of villages vary widely in different territories but will nearly always be less than 10,000 people, often a lot less. See <a href=\"http://wiki.openstreetmap.org/wiki/Key:place\" title=\"Key:place\">place</a>=<a href=\"/wiki/Tag:place%3Dneighbourhood\" title=\"Tag:place=neighbourhood\">neighbourhood</a> on how to tag divisions within a larger village.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(626, '', NULL, 'place', 'hamlet', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A smaller rural community typically with less than 100-200 inhabitants, few infrastructure.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
