(646, '', NULL, 'power', 'generator', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A device used to convert power from one form to another. Use in combination with <a href=\"http://wiki.openstreetmap.org/wiki/Key:generator:source\" title=\"Key:generator:source\">generator:source</a>=*, <a href=\"/wiki/Key:generator:method\" title=\"Key:generator:method\">generator:method</a>=* and <a href=\"/wiki/Key:generator:output\" title=\"Key:generator:output\">generator:output</a>=*.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
