(649, '', NULL, 'power', 'line', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A way following the path of (overground) power cables. For minor power lines with poles and not towers, you may want to use <a href=\"http://wiki.openstreetmap.org/wiki/Key:power\" title=\"Key:power\">power</a>=<a href=\"/wiki/Tag:power%3Dminor_line\" title=\"Tag:power=minor line\">minor_line</a>. Useful combinations: <a href=\"/wiki/Key:voltage\" title=\"Key:voltage\">voltage</a>=*, <a href=\"/wiki/Key:cables\" title=\"Key:cables\">cables</a>=* and <a href=\"/wiki/Key:wires\" title=\"Key:wires\">wires</a>=*. Please see the respective feature pages for details.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Power-tower_mapnik.png\" class=\"image\"><img alt=\"Power-tower mapnik.png\" src=\"http://wiki.openstreetmap.org/w/images/8/87/Power-tower_mapnik.png\" width=\"7\" height=\"7\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(650, '', NULL, 'power', 'minor_line', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A way following the path of (overground) minor power cables, supported by poles and not towers/pylons. (This isn''t quite so simple, as sometimes larger towers are replaced by smaller poles made with a stronger material; a better distinction might be based on voltage).', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Minor_line_mapnik.jpg\" class=\"image\"><img alt=\"Minor line mapnik.jpg\" src=\"http://wiki.openstreetmap.org/w/images/e/e5/Minor_line_mapnik.jpg\" width=\"100\" height=\"96\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(651, '', NULL, 'power', 'pole', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'For single (often wooden or concrete) poles carrying medium/low voltage electricity cables.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Minor_line_mapnik.jpg\" class=\"image\"><img alt=\"Minor line mapnik.jpg\" src=\"http://wiki.openstreetmap.org/w/images/e/e5/Minor_line_mapnik.jpg\" width=\"100\" height=\"96\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
