(653, '', NULL, 'power', 'substation', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A tag for electricity substations. These provide voltage step-up/step-down, switching, conditioning, etc. Substations may be large facilities (up to several acres) for very high voltage transmission lines or just small buildings or kiosks near the street for low voltage distribution lines. Useful combinations: <a href=\"http://wiki.openstreetmap.org/wiki/Key:voltage\" title=\"Key:voltage\">voltage</a>=*, <a href=\"/wiki/Key:substation\" title=\"Key:substation\">substation</a>=* and <a href=\"/wiki/Key:location\" title=\"Key:location\">location</a>=*, see the feature page for details.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(654, '', NULL, 'power', 'switch', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A tag for electricity switches which are devices which allow operators to power up &amp; down lines and transformer in substations or outside.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(655, '', NULL, 'power', 'tower', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'For towers or pylons carrying high voltage electricity cables. Normally constructed from steel latticework but tubular or solid pylons are also commonly used. Should not be used for medium or low voltage electricity conductors carried on single wooden poles which might be tagged <a href=\"http://wiki.openstreetmap.org/wiki/Key:power\" title=\"Key:power\">power</a>=<a href=\"/wiki/Tag:power%3Dpole\" title=\"Tag:power=pole\">pole</a>. See <a href=\"/wiki/Key:power\" title=\"Key:power\">power</a>=<a href=\"/wiki/Tag:power%3Dtower\" title=\"Tag:power=tower\">tower</a> for detailed tagging of tower types.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Power-tower_mapnik.png\" class=\"image\"><img alt=\"Power-tower mapnik.png\" src=\"http://wiki.openstreetmap.org/w/images/8/87/Power-tower_mapnik.png\" width=\"7\" height=\"7\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
