(665, '', NULL, 'railway', 'disused', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A section of railway which is no longer used but where the track and infrastructure remains in place. See the <a href=\"http://wiki.openstreetmap.org/w/index.php?title=Key:disused:*&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"Key:disused:* (page does not exist)\">disused:*</a>=* namespace for alternative tagging.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-railway_disused.png\" class=\"image\"><img alt=\"Rendering-railway disused.png\" src=\"http://wiki.openstreetmap.org/w/images/e/eb/Rendering-railway_disused.png\" width=\"125\" height=\"60\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(666, '', NULL, 'railway', 'funicular', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Cable driven inclined railways. In many cases they serve touristic interest, giving easy access to spectacular mountain views.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering_funicular.jpg\" class=\"image\"><img alt=\"Rendering funicular.jpg\" src=\"http://wiki.openstreetmap.org/w/images/8/8b/Rendering_funicular.jpg\" width=\"92\" height=\"82\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(667, '', NULL, 'railway', 'light_rail', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A higher-standard tram system, normally in its own right-of-way. Often it connects towns and thus reaches a considerable length (tens of kilometer).', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(668, '', NULL, 'railway', 'miniature', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/Ridable_miniature_railway\" class=\"extiw\" title=\"w:Ridable miniature railway\">Miniature railways</a> are narrower than narrow gauge and carry passengers. They can be found in parks.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Mini-railway-mapnik.png\" class=\"image\"><img alt=\"Mini-railway-mapnik.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/0/0d/Mini-railway-mapnik.png/100px-Mini-railway-mapnik.png\" width=\"100\" height=\"32\" srcset=\"/w/images/0/0d/Mini-railway-mapnik.png 1.5x, /w/images/0/0d/Mini-railway-mapnik.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(669, '', NULL, 'railway', 'monorail', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A railway with only a single rail. A monorail can run above the rail like in Las Vegas and <a href=\"http://wiki.openstreetmap.org/wiki/Disneyland\" title=\"Disneyland\">Disneyland</a> or can suspend below the rail like the <a href=\"http://en.wikipedia.org/wiki/Wuppertal_Schwebebahn\" class=\"extiw\" title=\"w:Wuppertal Schwebebahn\">Wuppertal Schwebebahn</a> (Germany).', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(670, '', NULL, 'railway', 'narrow_gauge', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Narrow-gauge passenger or freight trains. Narrow gauge railways can have mainline railway service like the <a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/Rhaetian_Railway\" class=\"extiw\" title=\"w:Rhaetian Railway\">Rhaetian Railway</a> in Switzerland or can be a small light industrial railway. Use <a href=\"/wiki/Key:gauge\" title=\"Key:gauge\">gauge</a>=* to specify the actual width of rails.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering_narrow_gauge.jpg\" class=\"image\"><img alt=\"Rendering narrow gauge.jpg\" src=\"http://wiki.openstreetmap.org/w/images/5/56/Rendering_narrow_gauge.jpg\" width=\"110\" height=\"106\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(671, '', NULL, 'railway', 'preserved', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A railway running historic trains, usually a tourist attraction (changed to preserved from preserved_rail as \"rail\" is redundant). Using <a href=\"http://wiki.openstreetmap.org/wiki/Key:railway:preserved\" title=\"Key:railway:preserved\">railway:preserved</a>=yes is an alternate method to mark railway as preserved.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Railway_preserved_rendered.PNG\" class=\"image\"><img alt=\"Railway preserved rendered.PNG\" src=\"http://wiki.openstreetmap.org/w/images/9/94/Railway_preserved_rendered.PNG\" width=\"100\" height=\"75\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(672, '', NULL, 'railway', 'rail', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Full sized passenger or freight trains in the standard gauge for the country or state.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Mapping-Features-Railroad-With-Station.png\" class=\"image\"><img alt=\"Mapping-Features-Railroad-With-Station.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/8/80/Mapping-Features-Railroad-With-Station.png/100px-Mapping-Features-Railroad-With-Station.png\" width=\"100\" height=\"67\" srcset=\"/w/images/thumb/8/80/Mapping-Features-Railroad-With-Station.png/150px-Mapping-Features-Railroad-With-Station.png 1.5x, /w/images/thumb/8/80/Mapping-Features-Railroad-With-Station.png/200px-Mapping-Features-Railroad-With-Station.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(673, '', NULL, 'railway', 'subway', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A city passenger rail service running mostly grade separated (see <a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/rapid_transit\" class=\"extiw\" title=\"wikipedia:rapid transit\">Wikipedia:rapid transit</a>).', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(674, '', NULL, 'railway', 'tram', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'One or two carriage rail vehicles, usually sharing motor road (<a rel=\"nofollow\" class=\"external text\" href=\"http://wiki.openstreetmap.orghttp://www.omegawiki.org/DefinedMeaning:tram_(6611)\">Other languages</a>).', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Mapping-Features-Tram-With-Halt.png\" class=\"image\"><img alt=\"Mapping-Features-Tram-With-Halt.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/2/2e/Mapping-Features-Tram-With-Halt.png/100px-Mapping-Features-Tram-With-Halt.png\" width=\"100\" height=\"100\" srcset=\"/w/images/thumb/2/2e/Mapping-Features-Tram-With-Halt.png/150px-Mapping-Features-Tram-With-Halt.png 1.5x, /w/images/2/2e/Mapping-Features-Tram-With-Halt.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
