(685, '', NULL, 'tunnel', 'yes', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'If the railway goes below ground. Should be always present on subways.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
