(872, '', NULL, 'sport', 'bowls', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Relation\" title=\"Relation\"><img alt=\"Relation\" src=\"/w/images/thumb/4/48/Osm_element_relation.svg/20px-Osm_element_relation.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/4/48/Osm_element_relation.svg/30px-Osm_element_relation.svg.png 1.5x, /w/images/thumb/4/48/Osm_element_relation.svg/40px-Osm_element_relation.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Bowls\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Bowls\" class=\"extiw\" title=\"wikipedia:en:Bowls\">Bowls</a> or lawn bowls is a sport in which the objective is to roll biased balls so that they stop close to a smaller ball called a  \"jack\" or \"kitty\". It is played on a pitch which may be flat (for \"flat-green bowls\") or convex or uneven (for \"crown-green bowls\"). It is normally played outdoors (although there are many indoor venues) and the outdoor surface is either natural grass, artificial turf, or cotula (in New Zealand).Useful combination: <a href=\"/wiki/Key:leisure\" title=\"Key:leisure\">leisure</a>=<a href=\"/wiki/Tag:leisure%3Dpitch\" title=\"Tag:leisure=pitch\">pitch</a>;<a href=\"/wiki/Tag:leisure%3Dstadium\" title=\"Tag:leisure=stadium\">stadium</a>;<a href=\"/wiki/Tag:leisure%3Dsports_centre\" title=\"Tag:leisure=sports centre\">sports_centre</a>, <a href=\"/wiki/Key:surface\" title=\"Key:surface\">surface</a>=*See Also: <a href=\"/wiki/Key:sport\" title=\"Key:sport\">sport</a>=<a href=\"/wiki/Tag:sport%3Dboules\" title=\"Tag:sport=boules\">boules</a>;<a href=\"/wiki/Tag:sport%3Dpelota\" title=\"Tag:sport=pelota\">pelota</a>;<a href=\"/wiki/Tag:sport%3D10pin\" title=\"Tag:sport=10pin\">10pin</a>, <a href=\"/wiki/Key:sport\" title=\"Key:sport\">sport</a>=<a href=\"/wiki/Tag:sport%3D9pin\" title=\"Tag:sport=9pin\">9pin</a>;<a href=\"/wiki/Tag:sport%3Dhorseshoes\" title=\"Tag:sport=horseshoes\">horseshoes</a>', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Lawn_bowls_pictogram.svg\" class=\"image\"><img alt=\"Lawn bowls pictogram.svg\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/7b/Lawn_bowls_pictogram.svg/100px-Lawn_bowls_pictogram.svg.png\" width=\"100\" height=\"100\" srcset=\"/w/images/thumb/7/7b/Lawn_bowls_pictogram.svg/150px-Lawn_bowls_pictogram.svg.png 1.5x, /w/images/thumb/7/7b/Lawn_bowls_pictogram.svg/200px-Lawn_bowls_pictogram.svg.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(873, '', NULL, 'sport', 'boxing', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Relation\" title=\"Relation\"><img alt=\"Relation\" src=\"/w/images/thumb/4/48/Osm_element_relation.svg/20px-Osm_element_relation.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/4/48/Osm_element_relation.svg/30px-Osm_element_relation.svg.png 1.5x, /w/images/thumb/4/48/Osm_element_relation.svg/40px-Osm_element_relation.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Boxing\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Boxing\" class=\"extiw\" title=\"wikipedia:en:Boxing\">Boxing</a> (pugilism, prize fighting, the sweet science or in Greek pygmachia) is a combat sport played in a boxing ring in which two people engage in a contest of strength, speed, reflexes, endurance, and will, by throwing punches  with gloved hands against each other.Useful combination: <a href=\"/wiki/Key:leisure\" title=\"Key:leisure\">leisure</a>=<a href=\"/wiki/Tag:leisure%3Dstadium\" title=\"Tag:leisure=stadium\">stadium</a>;<a href=\"/wiki/Tag:leisure%3Dsports_centre\" title=\"Tag:leisu