(874, '', NULL, 'sport', 'canadian_football', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Relation\" title=\"Relation\"><img alt=\"Relation\" src=\"/w/images/thumb/4/48/Osm_element_relation.svg/20px-Osm_element_relation.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/4/48/Osm_element_relation.svg/30px-Osm_element_relation.svg.png 1.5x, /w/images/thumb/4/48/Osm_element_relation.svg/40px-Osm_element_relation.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Canadian_football\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Canadian_football\" class=\"extiw\" title=\"wikipedia:en:Canadian football\">Canadian football</a> (CFL) is a form of gridiron football played in Canada in which two teams of 12 players each compete for territorial control of a field of play called a pitch. In Canada, the term football may refer to Canadian football and American football collectively, or either sport specifically, depending on context.Useful combination: <a href=\"/wiki/Key:leisure\" title=\"Key:leisure\">leisure</a>=<a href=\"/wiki/Tag:leisure%3Dpitch\" title