(877, '', NULL, 'sport', 'cliff_diving', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Relation\" title=\"Relation\"><img alt=\"Relation\" src=\"/w/images/thumb/4/48/Osm_element_relation.svg/20px-Osm_element_relation.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/4/48/Osm_element_relation.svg/30px-Osm_element_relation.svg.png 1.5x, /w/images/thumb/4/48/Osm_element_relation.svg/40px-Osm_element_relation.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Diving#Non-competitive_diving\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Diving#Non-competitive_diving\" class=\"extiw\" title=\"wikipedia:en:Diving\">Non-competitive diving</a> is jumping from a cliff or a rock into water. Such non-competitive diving can occur indoors and outdoors.  Outdoor diving typically takes place from cliffs or other rock formations either into fresh or salt water.  However, man-made diving platforms are sometimes constructed in popular swimming destinations.  Outdoor diving requires knowledge of the water depth and currents as conditions can be dangerous.Useful combination: <a href=\"/wiki/Key:natural\" title=\"Key:natural\">natural</a>=<a href=\"/wiki/Tag:natural%3Dcliff\" title=\"Tag:natural=cliff\">cliff</a>, <a href=\"/wiki/Key:height\" title=\"Key:height\">height</a>=*, <a href=\"/wiki/Key:depth\" title=\"Key:depth\">depth</a>=*, <a href=\"/wiki/Key:tidal\" title=\"Key:tidal\">tidal</a>=*, <a href=\"/wiki/Key:surface\" title=\"Key:surface\">surface</a>=*, <a href=\"/wiki/Key:note\" title=\"Key:note\">note</a>=*See Also: <a href=\"/wiki/Key:sport\" title=\"Key:sport\">sport</a>=<a href=\"/wiki/Tag:sport%3Dclimbing\" title=\"Tag:sport=climbing\">climbing</a>;<a href=\"/wiki/Tag:sport%3Dswimming\" title=\"Tag:sport=swimming\">swimming</a>', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Diving_pictogram.svg\" class=\"image\"><img alt=\"Diving pictogram.svg\" src=\"http://wiki.openstreetmap.org/w/images/thumb/9/94/Diving_pictogram.svg/100px-Diving_pictogram.svg.png\" width=\"100\" height=\"100\" srcset=\"/w/images/thumb/9/94/Diving_pictogram.svg/150px-Diving_pictogram.svg.png 1.5x, /w/images/thumb/9/94/Diving_pictogram.svg/200px-Diving_pictogram.svg.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(878, '', NULL, 'sport', 'climbing', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Relation\" title=\"Relation\"><img alt=\"Relation\" src=\"/w/images/thumb/4/48/Osm_element_relation.svg/20px-Osm_element_relation.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/4/48/Osm_element_relation.svg/30px-Osm_element_relation.svg.png 1.5x, /w/images/thumb/4/48/Osm_element_relation.svg/40px-Osm_element_relation.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Rock_climbing\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Rock_climbing\" class=\"extiw\" title=\"wikipedia:en:Rock climbing\">Rock climbing</a> marks elements to represent natural climbing sites (climbing areas, sectors, crags, halls, frozen waterfalls, etc.) or artificial climbs (Climbing walls, Indoor climbing, etc.).Useful combination: <a href=\"/wiki/Key:landuse\" title=\"Key:landuse\">landuse</a>=<a href=\"/wiki/Tag:landuse%3Drecreation_ground\" title=\"Tag:landuse=recreation ground\">recreation_ground</a>, <a href=\"/wiki/Key:leisure\" title=\"Key:leisure\">leisure</a>=<a href=\"/wiki/Tag: