(879, '', NULL, 'sport', 'climbing_adventure', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Relation\" title=\"Relation\"><img alt=\"Relation\" src=\"/w/images/thumb/4/48/Osm_element_relation.svg/20px-Osm_element_relation.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/4/48/Osm_element_relation.svg/30px-Osm_element_relation.svg.png 1.5x, /w/images/thumb/4/48/Osm_element_relation.svg/40px-Osm_element_relation.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Adventure_park\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Adventure_park\" class=\"extiw\" title=\"wikipedia:en:Adventure park\">Climbing Adventure</a> often called \"Adventure Park\", \"Ropes Courses\", \"Climbing Adventure\", \"Zip-line\", or \"Treetop Adventure\", can be used for the recreational sport when people get mountain hiking accessories and try to climb, walk or otherwise move on prebuilt wires and other objects high above on the trees using continuous safety measures. These are usually open for everyone including kids and do not require special abilities apart from good physical condition.Useful combination: <a href=\"/wiki/Key:landuse\" title=\"Key:landuse\">landuse</a>=<a href=\"/wiki/Tag:landuse%3Drecreation_ground\" title=\"Tag:landuse=recreation ground\">recreation_ground</a>, <a href=\"/wiki/Key:leisure\" title=\"Key:leisure\">leisure</a>=<a href=\"/wiki/Tag:leisure%3Dsports_centre\" title=\"Tag:leisure=sports centre\">sports_centre</a>See Also: <a href=\"/wiki/Key:sport\" title=\"Key:sport\">sport</a>=<a href=\"/wiki/Tag:sport%3Dclimbing\" title=\"Tag:sport=climbing\">climbing</a>', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(880, '', NULL, 'sport', 'cockfighting', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Relation\" title=\"Relation\"><img alt=\"Relation\" src=\"/w/images/thumb/4/48/Osm_element_relation.svg/20px-Osm_element_relation.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/4/48/Osm_element_relation.svg/30px-Osm_element_relation.svg.png 1.5x, /w/images/thumb/4/48/Osm_element_relation.svg/40px-Osm_element_relation.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Cockfight\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Cockfight\" class=\"extiw\" title=\"wikipedia:en:Cockfight\">Cockfighting</a> is a common spectator sport in many countries between two roosters (cocks), held in a ring called a cockpit.Useful combination: <a href=\"/wiki/Key:leisure\" title=\"Key:leisure\">leisure</a>=<a href=\"/wiki/Tag:leisure%3Dpitch\" title=\"Tag:leisure=pitch\">pitch</a> for informal rings.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0);";

