(882, '', NULL, 'sport', 'cricket_nets', '', 'This is not a sport! No not use this tag.Instead consider using <a href=\"http://wiki.openstreetmap.org/wiki/Key:leisure\" title=\"Key:leisure\">leisure</a>=<a href=\"/wiki/Tag:leisure%3Dpitch\" title=\"Tag:leisure=pitch\">pitch</a>, <a href=\"/wiki/Key:sport\" title=\"Key:sport\">sport</a>=<a href=\"/wiki/Tag:sport%3Dcricket\" title=\"Tag:sport=cricket\">cricket</a>, <a href=\"/wiki/Key:barrier\" title=\"Key:barrier\">barrier</a>=<a href=\"/wiki/Tag:barrier%3Dfence\" title=\"Tag:barrier=fence\">fence</a>', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(883, '', NULL, 'sport', 'croquet', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Relation\" title=\"Relation\"><img alt=\"Relation\" src=\"/w/images/thumb/4/48/Osm_element_relation.svg/20px-Osm_element_relation.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/4/48/Osm_element_relation.svg/30px-Osm_element_relation.svg.png 1.5x, /w/images/thumb/4/48/Osm_element_relation.svg/40px-Osm_element_relation.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Croquet\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Croquet\" class=\"extiw\" title=\"wikipedia:en:Croquet\">Croquet</a> is a sport or game that is played between two or more players embedded on a small grass playing court or pitch which involves hitting plastic or wooden balls with a mallet through hoops (often called \"wickets\" in the United States).Useful combination: <a href=\"/wiki/Key:leisure\" title=\"Key:leisure\">leisure</a>=<a href=\"/wiki/Tag:leisure%3Dpitch\" title=\"Tag:leisure=pitch\">pitch</a>;<a href=\"/wiki/Tag:leisure%3Dstadium\" title=\"Tag:leisure=stadium\">stadium</a>;<a href