(946, '', NULL, 'sport', 'user defined', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', '<a class=\"external text\" href=\"http://wiki.openstreetmap.org//taginfo.openstreetmap.org/keys/sport#values\">All commonly used values</a> according to <a href=\"/wiki/Taginfo\" title=\"Taginfo\">Taginfo</a>', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(947, '', NULL, 'tourism', 'alpine_hut', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Mountain_hut\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Mountain_hut\" class=\"extiw\" title=\"wikipedia:en:Mountain hut\">Alpine hut</a> or a mountain hut is a remote building positioned in the mountains designed to provided lodging accommodation for mountaineers, climbers and hikers. The access is usually restricted to foot, mountain bike or ski. Typically, these are operated by an <a href=\"http://en.wikipedia.org/wiki/List_of_alpine_clubs\" class=\"extiw\" title=\"w:List of alpine clubs\">Alpine Club</a> or a similar organisation.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Alpinehut.p.16.png\" class=\"image\"><img alt=\"Alpinehut.p.16.png\" src=\"http://wiki.openstreetmap.org/w/images/4/45/Alpinehut.p.16.png\" width=\"16\" height=\"16\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(948, '', NULL, 'tourism', 'apartment', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'This stands for a holiday apartment or holiday flat which is a place that can be rented for holiday purposes. They do not offer services like receptions, bars or breakfast like a hotel or a guesthouse would, although, normally these include a cooking facility. This tag can be applied to a building accommodating one or more holiday flats. It may be similar to the tag <a href=\"http://wiki.openstreetmap.org/wiki/Key:tourism\" title=\"Key:tourism\">tourism</a>=<a href=\"/wiki/Tag:tourism%3Dchalet\" title=\"Tag:tourism=chalet\">chalet</a> where these are found more as single houses in mountain regions, whereas, apartment is often found in villages, and in buildings with several flats.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(949, '', NULL, 'tourism', 'attraction', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Tourist_attraction\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Tourist_attraction\" class=\"extiw\" title=\"wikipedia:en:Tourist attraction\">Attraction</a> or tourist attraction is a general place of interest for visitors. Typically used for its natural or historical significance. This tag is often used in combination with other tags such as <a href=\"/wiki/Key:historic\" title=\"Key:historic\">historic</a>=*, <a href=\"/wiki/Key:building\" title=\"Key:building\">building</a>=*, <a href=\"/wiki/Key:amenity\" title=\"Key:amenity\">amenity</a>=*.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-area-tourism-attraction.png\" class=\"image\"><img alt=\"Rendering-area-tourism-attraction.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/a/a2/Rendering-area-tourism-attraction.png/40px-Rendering-area-tourism-attraction.png\" width=\"40\" height=\"29\" srcset=\"/w/images/thumb/a/a2/Rendering-area-tourism-attraction.png/60px-Rendering-area-tourism-attraction.png 1.5x, /w/images/thumb/a/a2/Rendering-area-tourism-attraction.png/80px-Rendering-area-tourism-attraction.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(950, '', NULL, 'tourism', 'artwork', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Public_art\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Public_art\" class=\"extiw\" title=\"wikipedia:en:Public art\">Artwork</a> is used to tag public pieces of art. Typically, these are outdoors.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(951, '', NULL, 'tourism', 'camp_site', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Campsite\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Campsite\" class=\"extiw\" title=\"wikipedia:en:Campsite\">Campsite</a>, camp ground or camping pitch is an area where people can temporarily use a shelter, such as a tent, camper van or sometimes a caravan. Typically, the area is spilt into \"pitches\" or \"sites\".', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Camping.16.svg\" class=\"image\"><img alt=\"Camping.16.svg\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/e4/Camping.16.svg/32px-Camping.16.svg.png\" width=\"32\" height=\"32\" srcset=\"/w/images/thumb/e/e4/Camping.16.svg/48px-Camping.16.svg.png 1.5x, /w/images/thumb/e/e4/Camping.16.svg/64px-Camping.16.svg.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(952, '', NULL, 'tourism', 'caravan_site', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:RV_park\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:RV_park\" class=\"extiw\" title=\"wikipedia:en:RV park\">Caravan site</a>, caravan park or RV park is an area where people with caravans, motorhomes, recreational vehicles can stay overnight, or longer, in allotted spaces known as \"pitches\" or \"sites\". They usually provide facilities including toilets, waste disposal, water supply, power supply etc.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Caravan-16.svg\" class=\"image\"><img alt=\"Caravan-16.svg\" src=\"http://wiki.openstreetmap.org/w/images/thumb/a/a1/Caravan-16.svg/32px-Caravan-16.svg.png\" width=\"32\" height=\"32\" srcset=\"/w/images/thumb/a/a1/Caravan-16.svg/48px-Caravan-16.svg.png 1.5x, /w/images/thumb/a/a1/Caravan-16.svg/64px-Caravan-16.svg.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(953, '', NULL, 'tourism', 'chalet', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'Chalet is a type of accommodation used in the hospitality industry to describe one or more detached cottages with self-contained cooking facilities and/or bathroom and toilet facilities. This is not to be confused with the Swiss term for a <a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/Chalet\" class=\"extiw\" title=\"w:Chalet\">type of wood house</a>, use the tags <a href=\"/wiki/Key:building\" title=\"Key:building\">building</a>=<a href=\"/wiki/Tag:building%3Dcabin\" title=\"Tag:building=cabin\">cabin</a> or <a href=\"/wiki/Key:building\" title=\"Key:building\">building</a>=<a href=\"/wiki/Tag:building%3Dyes\" title=\"Tag:building=yes\" class=\"mw-redirect\">yes</a> instead. Similar to <a href=\"/wiki/Key:tourism\" title=\"Key:tourism\">tourism</a>=<a href=\"/wiki/Tag:tourism%3Dapartment\" title=\"Tag:tourism=apartment\">apartment</a>, the tag apartment is often found in villages, and in buildings with several flats, while the tag chalet is found more as single houses in mountain regions.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Chalet.p.16.png\" class=\"image\"><img alt=\"Chalet.p.16.png\" src=\"http://wiki.openstreetmap.org/w/images/9/94/Chalet.p.16.png\" width=\"16\" height=\"16\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(954, '', NULL, 'tourism', 'gallery', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Art_museum\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Art_museum\" class=\"extiw\" title=\"wikipedia:en:Art museum\">Art gallery</a> or art museum is an area or typically a building that displays a variety of visual art exhibitions; The most common exhibits being paintings, contemporary art or photography. This is not to be confused with <a href=\"/wiki/Key:tourism\" title=\"Key:tourism\">tourism</a>=<a href=\"/wiki/Tag:tourism%3Dmuseum\" title=\"Tag:tourism=museum\">museum</a>.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(955, '', NULL, 'tourism', 'guest_house', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Guest_house\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Guest_house\" class=\"extiw\" title=\"wikipedia:en:Guest house\">Guest houses</a>, similar to a Hostel, provides lodging accommodation without a hotel license that is typically owner-operated. They usually offer a private room served with breakfast, but the staff is not convenient around-the-clock. These range from custom-built guest houses to family-based homes, frequently refer to as a bed and breakfast.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Guest_house.p.16.png\" class=\"image\"><img alt=\"Guest house.p.16.png\" src=\"http://wiki.openstreetmap.org/w/images/1/13/Guest_house.p.16.png\" width=\"16\" height=\"16\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
