(961, '', NULL, 'tourism', 'picnic_site', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', '<a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Picnic\" rel=\"nofollow\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a> <a href=\"http://en.wikipedia.org/wiki/en:Picnic\" class=\"extiw\" title=\"wikipedia:en:Picnic\">Picnic site</a> is an area that is suitable for eating outdoors and may have a number of facilities within it. For example they might include: toilets, water taps for drinking or cleaning, BBQ grills, benches, table with benches (<a href=\"/wiki/Picnic_table\" title=\"Picnic table\" class=\"mw-redirect\">picnic tables</a>) and covered structures for bad weather. They also may be used on a grassy area that is popular for picnics.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Table-16.svg\" class=\"image\"><img alt=\"Table-16.svg\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/7d/Table-16.svg/32px-Table-16.svg.png\" width=\"32\" height=\"32\" srcset=\"/w/images/thumb/7/7d/Table-16.svg/48px-Table-16.svg.png 1.5x, /w/images/thumb/7/7d/Table-16.svg/64px-Table-16.svg.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
