(968, '', NULL, 'waterway', 'river', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'For narrow rivers which will be rendered as a line.  For larger rivers see also <a href=\"http://wiki.openstreetmap.org/wiki/Key:waterway\" title=\"Key:waterway\">waterway</a>=<a href=\"/wiki/Tag:waterway%3Driverbank\" title=\"Tag:waterway=riverbank\">riverbank</a> (<a rel=\"nofollow\" class=\"external text\" href=\"http://www.omegawiki.org/DefinedMeaning:river_(3253)\">Other languages</a>).', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-waterway-river.png\" class=\"image\"><img alt=\"Rendering-waterway-river.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/3/31/Rendering-waterway-river.png/100px-Rendering-waterway-river.png\" width=\"100\" height=\"20\" srcset=\"/w/images/3/31/Rendering-waterway-river.png 1.5x, /w/images/3/31/Rendering-waterway-river.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(969, '', NULL, 'waterway', 'riverbank', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'Used for larger rivers in addition to <a href=\"http://wiki.openstreetmap.org/wiki/Key:waterway\" title=\"Key:waterway\">waterway</a>=<a href=\"/wiki/Tag:waterway%3Driver\" title=\"Tag:waterway=river\">river</a>, to define an area between the opposite riverbanks. See <a href=\"/wiki/Key:water\" title=\"Key:water\">water</a>=river for alternative tagging.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-waterway-riverbank.png\" class=\"image\"><img alt=\"Rendering-waterway-riverbank.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/c/cc/Rendering-waterway-riverbank.png/100px-Rendering-waterway-riverbank.png\" width=\"100\" height=\"100\" srcset=\"/w/images/c/cc/Rendering-waterway-riverbank.png 1.5x, /w/images/c/cc/Rendering-waterway-riverbank.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(970, '', NULL, 'waterway', 'stream', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A naturally-formed waterway that is too thin to be classed as a river. An active, able-bodied person should be able to jump over it if trees along it aren''t too thick.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-waterway-stream-mapnik.png\" class=\"image\"><img alt=\"Rendering-waterway-stream-mapnik.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/3/3f/Rendering-waterway-stream-mapnik.png/100px-Rendering-waterway-stream-mapnik.png\" width=\"100\" height=\"100\" srcset=\"/w/images/3/3f/Rendering-waterway-stream-mapnik.png 1.5x, /w/images/3/3f/Rendering-waterway-stream-mapnik.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(971, '', NULL, 'waterway', 'wadi', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A natural, dry (ephemeral) riverbed that contains water only during times of heavy rain or simply an intermittent stream, in semi-arid areas. Also known as a \"Wash\" in the deserts of America. It has been recommended to stop using this tag. For intermittent waterways use waterway=river/waterway=stream + intermittent=yes. For valleys natural=valley.', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-waterway-wadi-mapnik.png\" class=\"image\"><img alt=\"Rendering-waterway-wadi-mapnik.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ec/Rendering-waterway-wadi-mapnik.png/100px-Rendering-waterway-wadi-mapnik.png\" width=\"100\" height=\"16\" srcset=\"/w/images/e/ec/Rendering-waterway-wadi-mapnik.png 1.5x, /w/images/e/ec/Rendering-waterway-wadi-mapnik.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(972, '', NULL, 'waterway', 'drystream', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Dry stream bed - negative forms of erosion relief formed by the activity of temporary streams.Don''t use this tag. For intermittent waterways use waterway=stream + intermittent=yes. For valleys use natural=valley.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(973, '', NULL, 'waterway', 'canal', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'An artificial open waterway used for transportation, waterpower, or irrigation.(<a rel=\"nofollow\" class=\"external text\" href=\"http://wiki.openstreetmap.orghttp://www.omegawiki.org/DefinedMeaning:canal_(478)\">Other languages</a>).', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
