(977, '', NULL, 'waterway', 'boatyard', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a><a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'Boat yard â€“ a place for constructing, repairing and storing vessels out of the water.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(978, '', NULL, 'waterway', 'dam', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'A wall built across a river or stream to impound the water. A dam normally does not have water flowing over the top of it.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(979, '', NULL, 'waterway', 'weir', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A barrier built across a river, sometimes to divert water for industrial purposes. Water can still flow over the top.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(980, '', NULL, 'waterway', 'waterfall', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A <a href=\"http://wiki.openstreetmap.org/wiki/Waterfall\" title=\"Waterfall\" class=\"mw-redirect\">waterfall</a>, use in combination with <a href=\"/wiki/Key:natural\" title=\"Key:natural\">natural</a>=<a href=\"/wiki/Tag:natural%3Dcliff\" title=\"Tag:natural=cliff\">cliff</a>', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(981, '', NULL, 'waterway', 'lock_gate', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'To mark the position of gates at each end of a lock. Alternatively, for smaller locks use a single <a href=\"http://wiki.openstreetmap.org/wiki/Key:lock\" title=\"Key:lock\">lock</a>=<a href=\"/wiki/Tag:lock%3Dyes\" title=\"Tag:lock=yes\" class=\"mw-redirect\">yes</a> node in the middle of the lock.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(982, '', NULL, 'waterway', 'turning_point', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'A place to turn the driving direction for vessels, where the boats are longer than the river/canal is wide. Use <a href=\"http://wiki.openstreetmap.org/wiki/Key:maxlength\" title=\"Key:maxlength\">maxlength</a>=* to denote the maximum length of the vessel.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(983, '', NULL, 'waterway', 'water_point', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>', 'This tag is for ports/marinas where you can get large amounts of potable water.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0);";

