(984, '', NULL, 'intermittent', 'yes', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Indicates that the waterway does not have a permanent flow (i.e. is sometimes/often dry).', '<a href=\"http://wiki.openstreetmap.org/wiki/File:Rendering-intermittent-river-mapnik.png\" class=\"image\"><img alt=\"Rendering-intermittent-river-mapnik.png\" src=\"http://wiki.openstreetmap.org/w/images/thumb/0/09/Rendering-intermittent-river-mapnik.png/100px-Rendering-intermittent-river-mapnik.png\" width=\"100\" height=\"17\" srcset=\"/w/images/0/09/Rendering-intermittent-river-mapnik.png 1.5x, /w/images/0/09/Rendering-intermittent-river-mapnik.png 2x\" /></a>', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(985, '', NULL, 'seasonal', 'yes, spring, summer, autumn, winter, wet, dry', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Indicates that a waterway has a seasonal (yearly cyclic) flow.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(986, '', NULL, 'lock', 'yes', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a> (<a href=\"/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>)', 'A <a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Lock_(water_transport)\" class=\"extiw\" title=\"w:en:Lock (water transport)\">lock</a> is used for moving boats between waterways at two different levels. Can tag either the section of the way between the gates (detailed) or just a single node in the waterway (less detailed).', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(987, '', NULL, 'mooring', 'yes,  private,  no', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'A length of bank where boats are explicitly permitted to moor. <a href=\"http://wiki.openstreetmap.org/wiki/Key:maxstay\" title=\"Key:maxstay\">maxstay</a>=* should be used for timing information.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
