(989, '', NULL, 'tunnel', 'culvert', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a> (<a href=\"/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a>)', 'For streams passing under a road in culverts use <a href=\"http://wiki.openstreetmap.org/wiki/Key:tunnel\" title=\"Key:tunnel\">tunnel</a>=<a href=\"/wiki/Tag:tunnel%3Dculvert\" title=\"Tag:tunnel=culvert\">culvert</a>+<a href=\"/wiki/Key:layer\" title=\"Key:layer\">layer</a>=<a href=\"/wiki/Tag:layer%3D-1\" title=\"Tag:layer=-1\" class=\"mw-redirect\">-1</a> on the section of stream passing under the road. Don''t use either of these tags for streams passing under bridges.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(990, '', NULL, 'waterway', 'user defined', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', '<a class=\"external text\" href=\"http://wiki.openstreetmap.org//taginfo.openstreetmap.org/keys/waterway#values\">All commonly used values</a> according to <a href=\"/wiki/Taginfo\" title=\"Taginfo\">Taginfo</a>', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(991, '', NULL, 'addr:housenumber', 'user defined', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'The <a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/House_numbering\" class=\"extiw\" title=\"wikipedia:House numbering\">house number</a> (may contain letters, dashes or other characters).<a href=\"/wiki/Addresses\" title=\"Addresses\">Addresses</a> describes ways to tag a single building with multiple addresses. Please do not only tag <a href=\"/wiki/Key:addr:housenumber\" title=\"Key:addr:housenumber\" class=\"mw-redirect\">addr:housenumber</a>=*, but also add at least <a href=\"/wiki/Key:addr:street\" title=\"Key:addr:street\" class=\"mw-redirect\">addr:street</a>=* (or map the belonging to a street with a relation using <a href=\"/wiki/Relation:associatedStreet\" title=\"Relation:associatedStreet\">associatedStreet relation</a> or <a href=\"/wiki/Relation:street\" title=\"Relation:street\">street relation</a>.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(992, '', NULL, 'addr:housename', 'user defined', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'The name of a house. This is sometimes used in some countries like England instead of (or in addition to) a house number.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(993, '', NULL, 'addr:street', 'user defined', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Node\" title=\"Node\"><img alt=\"Node\" src=\"http://wiki.openstreetmap.org/w/images/thumb/7/76/Osm_element_node.svg/20px-Osm_element_node.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/7/76/Osm_element_node.svg/30px-Osm_element_node.svg.png 1.5x, /w/images/thumb/7/76/Osm_element_node.svg/40px-Osm_element_node.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'The name of the respective street. A way with <a href=\"http://wiki.openstreetmap.org/wiki/Key:highway\" title=\"Key:highway\">highway</a>=* and the corresponding name should be found nearby. The belonging to a street can alternatively be represented by a <a href=\"/wiki/Relation:associatedStreet\" title=\"Relation:associatedStreet\">associatedStreet relation</a> or <a href=\"/wiki/Relation:street\" title=\"Relation:street\">street relation</a>. The keys <a href=\"/wiki/Key:addr:housenumber\" title=\"Key:addr:housenumber\" class=\"mw-redirect\">addr:housenumber</a>=* and <a href=\"/wiki/Key:addr:street\" title=\"Key:addr:street\" class=\"mw-redirect\">addr:street</a>=* in principle are the only necessary ones if there are valid border polygons. If you are not sure if it is so, just add <a href=\"/wiki/Key:addr:city\" title=\"Key:addr:city\" class=\"mw-redirect\">addr:city</a>=*, <a href=\"/wiki/Key:addr:postcode\" title=\"Key:addr:postcode\" class=\"mw-redirect\">addr:postcode</a>=* and <a href=\"/wiki/Key:addr:country\" title=\"Key:addr:country\" class=\"mw-redirect\">addr:country</a>=*.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
