(1098, '', NULL, 'access', 'agricultural / delivery / designated / destination / forestry / no / official / permissive / private / unknown / yes', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'General access permission.\r\nagricultural â€“ Only for agricultural traffic\r\ndelivery â€“ Only when delivering to the element.\r\ndesignated â€“ A preferred or designated route for a specific vehicle type or types. Not compulsory but often marked by a traffic sign\r\ndestination â€“ Used for ways in designated local traffic areas, where traffic should only enter if its destination is within the area\r\nforestry â€“ Only for forestry traffic\r\nno â€“ No access for the general public. Consider using another tag indicating who can use the element\r\nofficial â€“ The way is dedicated to a specific mode of travel by law. Usually marked by traffic signs and exclusive. In Germany use is also compulsory. clarification needed\r\npermissive â€“ Open to general traffic until such time as the owner revokes the permission which they are legally allowed to do at any time in the future.\r\nprivate â€“ Only with permission of the owner on an individual basis\r\nunknown â€“ No information provided on access. This is the default value for most features with a general assumption that access is allowed for all purposes\r\nyes â€“ The public has an official, legal right of access, i.e. it''s a right of way  (default value)', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(1099, '', NULL, 'agricultural', 'yes / no', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Access permission for agricultural vehicles, e.g. tractors.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(1100, '', NULL, 'atv', 'For values see access above', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Access restricted to wheeled vehicles 1.27m (50 inches) or less in width, for example <a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:All-terrain_vehicle\" title=\"wikipedia:en:All-terrain vehicle\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a>&#160;<a href=\"http://en.wikipedia.org/wiki/en:All-terrain_vehicle\" class=\"extiw\" title=\"wikipedia:en:All-terrain vehicle\">ATV</a>', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(1101, '', NULL, 'bdouble', 'For values see access above', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a> <a href=\"/wiki/Elements#Area_.28closed_way.29\" title=\"Area\"><img alt=\"Area\" src=\"/w/images/thumb/e/e6/Osm_element_area.svg/20px-Osm_element_area.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/e6/Osm_element_area.svg/30px-Osm_element_area.svg.png 1.5x, /w/images/thumb/e/e6/Osm_element_area.svg/40px-Osm_element_area.svg.png 2x\" /></a>', 'Access permission for <a href=\"http://wiki.openstreetmap.orghttp://en.wikipedia.org/wiki/en:Road_train#B-double\" title=\"wikipedia:en:Road train#B-double\"><img alt=\"Wikipedia\" src=\"http://wiki.openstreetmap.org/w/images/2/24/Wikipedia-16px.png\" width=\"16\" height=\"16\" /></a>&#160;<a href=\"http://en.wikipedia.org/wiki/en:Road_train#B-double\" class=\"extiw\" title=\"wikipedia:en:Road train\">Road Train B-double</a>. A B-double (B-Train) consists of a prime mover towing a specialised trailer (known as a \"lead\" or \"A\"-trailer) that has a fifth-wheel mounted on the rear towing another semi-trailer, resulting in two articulation points.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
(1102, '', NULL, 'bicycle', 'For values see access above + dismount', '<a href=\"http://wiki.openstreetmap.org/wiki/Elements#Way\" title=\"Way\"><img alt=\"Way\" src=\"http://wiki.openstreetmap.org/w/images/thumb/e/ee/Osm_element_way.svg/20px-Osm_element_way.svg.png\" width=\"20\" height=\"20\" srcset=\"/w/images/thumb/e/ee/Osm_element_way.svg/30px-Osm_element_way.svg.png 1.5x, /w/images/thumb/e/ee/Osm_element_way.svg/40px-Osm_element_way.svg.png 2x\" /></a>', 'Access permission for bicycles. Usage of <a href=\"http://wiki.openstreetmap.org/wiki/Key:bicycle\" title=\"Key:bicycle\">bicycle</a>=<a href=\"/wiki/Tag:bicycle%3Ddismount\" title=\"Tag:bicycle=dismount\" class=\"mw-redirect\">dismount</a> and <a href=\"/wiki/Key:bicycle\" title=\"Key:bicycle\">bicycle</a>=<a href=\"/wiki/Tag:bicycle%3Dno\" title=\"Tag:bicycle=no\" class=\"mw-redirect\">no</a> will vary in different countries. If according to local traffic rules a bicycle is no longer seen as a bicycle when there''s no one driving it, then there''s no need for using <a href=\"/wiki/Key:bicycle\" title=\"Key:bicycle\">bicycle</a>=<a href=\"/wiki/Tag:bicycle%3Ddismount\" title=\"Tag:bicycle=dismount\" class=\"mw-redirect\">dismount</a>. If the local legislation still sees an undriven bicycle as a bicycle then you may need to use both <a href=\"/wiki/Key:bicycle\" title=\"Key:bicycle\">bicycle</a>=<a href=\"/wiki/Tag:bicycle%3Ddismount\" title=\"Tag:bicycle=dismount\" class=\"mw-redirect\">dismount</a> and <a href=\"/wiki/Key:bicycle\" title=\"Key:bicycle\">bicycle</a>=<a href=\"/wiki/Tag:bicycle%3Dno\" title=\"Tag:bicycle=no\" class=\"mw-redirect\">no</a>.', '', NULL, 1, NULL, NULL, '', 'none', 0, 0, 0, 0),
